About the job
Credit Sesame is a financial app for consumers who want to be confident their finances are under control. The platform uses AI to help consumers achieve credit health and financial fitness by managing and growing their credit and cash together. An all-in-one app to monitor credit score daily, receive insightful credit improvement and finance recommendations, and find the right credit cards and loans.

Credit Sesame is looking for a Frontend Engineer to be at the forefront of designing, building and maintaining our next-generation website. Have you worked on a React-based high-traffic web application? Do you enjoy working with product managers and designers? Are you passionate about bringing together design with technology to create user experiences that delight our users? Do you enjoy mission-driven startup environments? If so, this role is for you!

You'll...

develop our Credit Sesame web application;
execute, deliver, and scale consumer-facing product features;
work cross-functionally with product managers and UX design;
collaborate with other technology teams and architects to solve complex problems;
design, build and maintain the next generation of our website to provide the best experience for our users;
ensure feature quality through extensive testing (unit, integration, functional, performance, and regression) with a focus on automation;
provide guidance on best practices for developing modern responsive websites;
work within a cross-functional Agile team.

You’re a great fit for our team because…

you have at least 7+ years experience in software engineering with deep expertise in frontend development; broad experience in building modern JavaScript-based web and mobile products;
you have at least 4+ years extensive expertise in React, JavaScript, HTML and CSS;
you have extensive hands-on experience with JavaScript frameworks & libraries. e.g React;
you have strong expertise in RESTful APIs and how to use them in practice;
you have expertise in writing effective unit, integration, and end-user automation tests ;
you’ve worked with technology for implementing A/B testing (e.g. Optimizely);
you are experienced in using code versioning tools such as Git or equivalent;
you've architected at least one frontend application;
you have exposure to mobile development with either native or web-to-native tooling and frameworks;
you have experience in Agile/Scrum framework;
you’re comfortable working with a distributed team;
you have strong people skills, specifically in collaboration, teamwork, coaching, and mentoring;
you have Bachelor’s degree in Computer Science or similar technical disciplines.

You'll love it here because...

you’ll have equity in a pre-IPO company backed by top VCs;
we offer comprehensive medical, dental, and vision insurance;
we offer a monthly home office stipend;
we offer a professional development stipend to support your continued growth
we offer flexible paid time off;
we have 10 paid holidays and additional 6 Sesame Wellness days;
we prize EQ and empathy, and have a culture that emphasizes total wellness, including work-life harmony.

At Credit Sesame, base pay is one part of our total compensation package. Actual salary will vary based on a candidate’s location, qualifications, skills, and experience. Additionally, this role is eligible to participate in Credit Sesame’s bonus and equity plan. The estimated pay range for this role in the San Francisco Bay Area is $165,000 - $190,000 and outside of the San Francisco Bay Area is $160,000 - $185,000.

We are open to hiring for this role in the following states where we are set up to hire employees: CA, CO, GA, NC, NJ, NV, OR, PA, and TX.

We are committed to equal employment opportunity regardless of race, color, ancestry, religion, sex, national origin, sexual orientation, age, citizenship, marital status, disability, gender, gender identity or expression, or veteran status. We are proud to be an equal opportunity workplace.

By clicking "Submit Application" (or related call to action), you acknowledge that you have read the Credit Sesame Employment Privacy Notice and hereby freely and unambiguously give informed consent to the collection, processing, use, and storage of your personal information as described therein.
